import { HashRouter } from "react-router-dom";
import Navbar from "./Navbar";
import Pages from "./Pages";
import Footer from "./Footer";

import "../css/App.css";

import { Provider } from "react-redux";
import store from "../store/store";


function App() {


  return (

      <Provider store={store}>
        <div className="App">
          <header>
            <Navbar />
          </header>
          <main>
            <Pages />
          </main>
          <footer>
            <Footer />
          </footer>
        </div>
      </Provider>

  );
}

export default App;
